<div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x2 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0">Captulo I </div><div class="t m0 x3 h2 y3 ff1 fs0 fc1 sc0 ls0 ws0">Matemtica Financeira </div><div class="t m0 x4 h3 y4 ff2 fs0 fc0 sc0 ls0 ws0">Neste capitulo, iremos estudar vrias situaes envolvendo <span class="_ _0"></span>Matemtica </div><div class="t m0 x4 h3 y5 ff2 fs0 fc0 sc0 ls0 ws0">financeira.  </div><div class="t m0 x5 h2 y6 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="ff1">Porcentagem </span></span></div><div class="t m0 x4 h3 y7 ff2 fs0 fc0 sc0 ls0 ws0">Leia a informao a seguir: </div><div class="t m0 x4 h3 y8 ff2 fs0 fc0 sc0 ls0 ws0">Segundo o comit Gestor da Internet no Brasi<span class="_ _2"></span>l, e<span class="_ _0"></span>ntre outubro de 2014 e maro </div><div class="t m0 x4 h3 y9 ff2 fs0 fc0 sc0 ls0 ws0">de 2015, 50 em cada 100 domiclios brasileiros possuam computador. </div><div class="t m0 x6 h3 ya ff4 fs0 fc0 sc0 ls0 ws0">A relao 50 em cada 100 pode ser representada <span class="ff2">por uma frao cujo </span></div><div class="t m0 x6 h4 yb ff2 fs0 fc0 sc0 ls0 ws0">denominador  igual a 100, isto , <span class="ff5 fs1"></span></div><div class="t m0 x7 h5 yc ff5 fs2 fc0 sc0 ls1 ws0"></div><div class="t m0 x8 h5 yd ff5 fs2 fc0 sc0 ls1 ws0"></div><div class="t m0 x9 h3 yb ff2 fs0 fc0 sc0 ls2 ws0">, <span class="ls0"> que tambm pode ser representada </span></div><div class="t m0 x6 h3 ye ff2 fs0 fc0 sc0 ls0 ws0">na forma decimal ou em porcentagem. </div><div class="t m0 xa h6 yf ff5 fs0 fc0 sc0 ls3 ws0"></div><div class="t m0 xb h6 y10 ff5 fs0 fc0 sc0 ls3 ws0"></div><div class="t m0 xc h7 y11 ff5 fs0 fc0 sc0 ls0 ws0"><span class="_ _3"> </span><span class="_ _3"> </span><span class="_ _3"> </span><span class="ls3"><span class="_ _4"> </span></span><span class="_ _3"> </span>  <span class="ls4"><span class="_ _0"></span></span><span class="_ _5"> </span><span class="_ _0"></span><span class="_ _0"></span><span class="ff2 fs3"> </span></div><div class="t m0 x4 h3 y12 ff2 fs0 fc0 sc0 ls0 ws0">A porcentagem corresponde  parte considerada de um to<span class="_ _0"></span>tal de 100 partes. </div><div class="t m0 x4 h3 y13 ff2 fs0 fc0 sc0 ls0 ws0">Para indic-la, utilizamos o smbolo %. Toda razo  </div><div class="t m0 xd h5 y14 ff5 fs2 fc0 sc0 ls0 ws0"></div><div class="t m0 xe h5 y15 ff5 fs2 fc0 sc0 ls0 ws0"></div><div class="t m0 xf h2 y13 ff2 fs0 fc0 sc0 ls0 ws0">   denominada <span class="ff1">taxa </span></div><div class="t m0 x4 h2 y16 ff1 fs0 fc0 sc0 ls0 ws0">percentual.  </div><div class="t m0 x4 h3 y17 ff2 fs0 fc0 sc0 ls0 ws0">Toda frao decimal ou equivalente a ela pode ser escrita na forma de </div><div class="t m0 x4 h3 y18 ff2 fs0 fc0 sc0 ls0 ws0">porcentagem. </div><div class="t m0 x4 h2 y19 ff1 fs0 fc1 sc0 ls0 ws0">Exemplo  </div><div class="t m0 x4 h3 y1a ff2 fs0 fc0 sc0 ls0 ws0">Em uma sala de aula do 3 ano do ensino Mdio h 25 alunos, send<span class="_ _2"></span>o que, </div><div class="t m0 x4 h3 y1b ff2 fs0 fc0 sc0 ls0 ws0">desses, 12 so do sexo masculino. Podemos determinar de di<span class="_ _2"></span>ferentes </div><div class="t m0 x4 h3 y1c ff2 fs0 fc0 sc0 ls0 ws0">maneiras a taxa percentual de alunos do sexo masculino da sala: </div><div class="t m0 x5 h3 y1d ff6 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span><span class="fc0">Como 12 em cada 25 alunos so do <span class="_ _0"></span>sexo masculino, obte<span class="_ _2"></span>mos a frao<span class="_ _0"></span> </span></span></div><div class="t m0 x10 h5 y1e ff5 fs2 fc0 sc0 ls1 ws0"></div><div class="t m0 x10 h5 y1f ff5 fs2 fc0 sc0 ls1 ws0"></div><div class="t m0 x11 h8 y20 ff2 fs4 fc0 sc0 ls0 ws0">. </div><div class="t m0 x4 h3 y21 ff2 fs0 fc0 sc0 ls0 ws0">Escrevendo uma frao equivalente a<span class="ls2">  </span></div><div class="t m0 x12 h5 y22 ff5 fs2 fc0 sc0 ls1 ws0"></div><div class="t m0 x12 h5 y23 ff5 fs2 fc0 sc0 ls1 ws0"></div><div class="t m0 x13 h3 y21 ff2 fs0 fc0 sc0 ls0 ws0">  com denominador igual a 100, </div><div class="t m0 x4 h3 y24 ff2 fs0 fc0 sc0 ls0 ws0">temos: </div><div class="t m0 x14 h9 y25 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x14 h9 y26 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x15 h9 y27 ff5 fs4 fc0 sc0 ls0 ws0"></div><div class="t m0 x16 h9 y25 ff5 fs4 fc0 sc0 ls5 ws0"><span class="ls0">  </span></div><div class="t m0 x16 h9 y26 ff5 fs4 fc0 sc0 ls5 ws0"><span class="ls0">  </span></div><div class="t m0 x12 h9 y27 ff5 fs4 fc0 sc0 ls0 ws0"></div><div class="t m0 x17 h9 y25 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x18 h9 y26 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x19 h8 y27 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _7"> </span><span class="ls5"></span><span class="ff2"> </span></div><div class="t m0 x5 h3 y28 ff6 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span><span class="fc0">Utilizando nmero decimal: </span></span></div><div class="t m0 x1a h9 y29 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x1a h9 y2a ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x1b h9 y2b ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _4"> </span><span class="_ _0"></span><span class="ls5"><span class="_ _4"> </span></span></div><div class="t m0 x13 h9 y29 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x1c h9 y2a ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x1d h8 y2b ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _4"> </span><span class="ls5"></span><span class="ff2"> </span></div><div class="t m0 x4 h3 y2c ff2 fs0 fc0 sc0 ls0 ws0"> <span class="_ _8"> </span> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x1e y2d w3 ha" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x4 h3 y2 ff2 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x5 h3 y2e ff6 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span><span class="fc0">Utilizando regra de trs: </span></span></div><div class="t m0 x1f h9 y2f ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x1f h9 y30 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x20 h9 y31 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _9"></span></div><div class="t m0 x3 h9 y2f ff5 fs4 fc0 sc0 ls0 ws0"></div><div class="t m0 x21 h9 y30 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x22 h8 y31 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _7"> </span><span class="ls5"></span><span class="_ _7"> </span><span class="_ _7"> </span><span class="ls5"><span class="_ _7"> </span></span><span class="_ _4"> </span><span class="_ _a"> </span><span class="_ _7"> </span><span class="ls5"></span><span class="ff2"> </span></div><div class="t m0 x4 h3 y32 ff2 fs0 fc0 sc0 ls0 ws0">Portanto, a taxa percentual de alunos do sexo masculino dessa sala  48% </div><div class="t m0 x4 h3 y33 ff2 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h2 y34 ff1 fs0 fc2 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x4 h2 y35 ff1 fs0 fc2 sc0 ls0 ws0">R1.<span class="ff2"> <span class="fc0">A mensalidade de um curso de ingls no ms de setembro era de </span></span></div><div class="t m0 x4 h3 y36 ff2 fs0 fc0 sc0 ls0 ws0">R$360,00. No ms seguinte, o valor da mensalidade sofreu um acrscimo <span class="_ _0"></span>de </div><div class="t m0 x4 h3 y37 ff2 fs0 fc0 sc0 ls0 ws0">9%. Qual o valor da mensalidade aps o acrscimo? </div><div class="t m0 x4 h3 y38 ff2 fs0 fc2 sc0 ls0 ws0">Resoluo </div><div class="t m0 x4 h3 y39 ff2 fs0 fc0 sc0 ls0 ws0">Podemos calcular o valor da mensalidade aps o acrscimo de 2 maneiras. <span class="_ _0"></span> </div><div class="t m0 x4 h2 y3a ff1 fs0 fc0 sc0 ls0 ws0">1 Maneira:<span class="ff2"> calculamos o valor correspondente a 9% da mensalidade antes do </span></div><div class="t m0 x4 h3 y3b ff2 fs0 fc0 sc0 ls0 ws0">acrscimo e, em seguida, adicionamos o valor obtido ao da mensalidade de </div><div class="t m0 x4 h3 y3c ff2 fs0 fc0 sc0 ls0 ws0">setembro: </div><div class="t m0 x23 h9 y3d ff5 fs4 fc0 sc0 ls5 ws0"><span class="ls0"><span class="ls6"><span class="_ _0"></span></span></span><span class="_ _4"> </span><span class="ls0"><span class="_ _5"></span></span></div><div class="t m0 x24 h9 y3e ff5 fs4 fc0 sc0 ls0 ws0"></div><div class="t m0 x16 h9 y3f ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x8 h3 y3d ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _b"></span><span class="_ _5"></span><span class="ls5"><span class="_ _7"> </span></span><span class="_ _7"> </span><span class="ls5"></span><span class="_ _9"></span><span class="ls5"><span class="_ _7"> </span></span><span class="_ _7"> </span><span class="ls5"></span><span class="ff2 fs0"> </span></div><div class="t m0 x25 h3 y40 ff5 fs4 fc0 sc0 ls5 ws0"> <span class="ls0"> </span><span class="ls0"><span class="_ _4"> </span><span class="_ _7"> </span></span><span class="ls0"><span class="ff2 fs0"> </span></span></div><div class="t m0 x4 h2 y41 ff1 fs0 fc0 sc0 ls0 ws0">2Maneira:<span class="ff2"> Consideramos o valor da mensalidade antes do acrscimo como </span></div><div class="t m0 x4 h8 y42 ff2 fs0 fc0 sc0 ls0 ws0">100%, que, ento, aps o acrscimo passou a ser 100% + 9% = 109%:<span class="fs4"> </span></div><div class="t m0 x26 h9 y43 ff5 fs4 fc0 sc0 ls5 ws0"><span class="ls0"><span class="ls6"><span class="_ _0"></span></span></span><span class="_ _4"> </span><span class="ls0"></span></div><div class="t m0 x27 h9 y44 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x27 h9 y45 ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x28 h8 y43 ff5 fs4 fc0 sc0 ls0 ws0"> <span class="ls5"><span class="_ _4"> </span></span><span class="_ _7"> </span><span class="ls5"></span><span class="_ _5"></span><span class="ls5"><span class="_ _7"> </span></span><span class="_ _7"> </span><span class="ls5"></span><span class="ff2"> </span></div><div class="t m0 x4 h3 y46 ff2 fs0 fc0 sc0 ls0 ws0">Portanto, o valor da mensalidade aps o acrscimo  R$392,40. </div><div class="t m0 x4 h2 y47 ff1 fs0 fc1 sc0 ls0 ws0"> <span class="_ _8"> </span> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf3" class="pf w0 h0" data-page-no="3"><div class="pc pc3 w0 h0"><img class="bi x0 y48 w1 hb" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x5 h2 y2 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="ff1">A<span class="_ _2"></span>crsc<span class="_ _0"></span>imos e descontos sucessivos </span></span></div><div class="t m0 x4 h3 y3 ff2 fs0 fc0 sc0 ls0 ws0">No tpico anterior, vimos algumas situaes env<span class="_ _2"></span>olvendo acrscimos e </div><div class="t m0 x4 h3 y49 ff2 fs0 fc0 sc0 ls0 ws0">descontos. Nelas, tantos os acrscimos quanto os descontos incidiam <span class="_ _0"></span>sobre o </div><div class="t m0 x4 h3 y4a ff2 fs0 fc0 sc0 ls0 ws0">valor inicial. Agora, iremos estudar algumas situaes envolvendo acrscimos </div><div class="t m0 x4 h3 y4b ff2 fs0 fc0 sc0 ls0 ws0">e descontos sucessivos. </div><div class="t m0 x4 h2 y4c ff1 fs0 fc1 sc0 ls0 ws0">Exemplo </div><div class="t m0 x4 h3 y4d ff2 fs0 fc0 sc0 ls0 ws0">Em um supermercado,1L de leite custava R$3,80. Em razo da baix<span class="_ _2"></span>a </div><div class="t m0 x4 h3 y4e ff2 fs0 fc0 sc0 ls0 ws0">produtividade na entressafra, o produto teve, durante trs semanas, acrscimo </div><div class="t m0 x4 h3 y4f ff2 fs0 fc0 sc0 ls0 ws0">de 5%, 2% e 3%, respectivamente. </div><div class="t m0 x4 h3 y50 ff2 fs0 fc0 sc0 ls0 ws0">(Grfico) </div><div class="t m0 x4 h3 y51 ff2 fs0 fc0 sc0 ls0 ws0">Podemos calcular o preo do litro de leite neste supermercado ap<span class="_ _2"></span>s o </div><div class="t m0 x4 h3 y52 ff2 fs0 fc0 sc0 ls0 ws0">acrscimo da seguinte maneira: </div><div class="t m0 x4 h2 y53 ff1 fs0 fc0 sc0 ls0 ws0">1 Acrscimo:<span class="ff2"> <span class="_ _c"> </span><span class="ff5 fs4 ls5"></span></span></div></div><div class="c x1 y1 w4 h0"><div class="t m0 x29 h9 y54 ff5 fs4 fc0 sc0 ls0 ws0"></div></div><div class="c xc y1 w5 h0"><div class="t m0 x2a h9 y54 ff5 fs4 fc0 sc0 ls0 ws0"></div></div><di