<div id="pf5" class="pf w0 h0" data-page-no="5"><div class="pc pc5 w0 h0"><img class="bi x1e y95 w3 hd" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x5 h2 y2 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="ff1">Juro </span></span></div><div class="t m0 x4 h2 y3 ff2 fs0 fc0 sc0 ls0 ws0">Neste tpico, iremos estudar o <span class="ff1">juro</span> <span class="ff1">simples</span> e o <span class="ff1">juro composto. </span></div><div class="t m0 x4 h3 y4 ff2 fs0 fc0 sc0 ls0 ws0">Simone fez uma aplicao no valor de R$ 1<span class="_ _0"></span> 000,00 durante 7 meses<span class="_ _2"></span>,  taxa de </div><div class="t m0 x4 h3 y5 ff2 fs0 fc0 sc0 ls0 ws0">juro simples de 0,65% a.m. (ao ms). Podemos calcular o montante obtido por </div><div class="t m0 x4 h3 y96 ff2 fs0 fc0 sc0 ls0 ws0">Simone ao final da aplicao da seguinte maneira: </div><div class="t m0 x5 h3 y97 ff6 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span><span class="fc0">capital (valor da aplicao): R$1 000,00 <span class="ff5"></span> c <span class="ff5"></span>1 <span class="lsc">000</span> </span></span></div><div class="t m0 x5 h3 y98 ff6 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span><span class="fc0">tempo (perodo da aplicao): 7 meses  <span class="ff5"></span> t <span class="ff5"></span>7 </span></span></div><div class="t m0 x5 h3 y99 ff6 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span><span class="fc0">taxa de juro: 0,65% a. m. <span class="ff5"></span> i <span class="ff5"></span>0,65%<span class="ff5"></span>0,0<span class="_ _0"></span>065 </span></span></div><div class="t m0 x4 h3 y9a ff2 fs0 fc0 sc0 ls0 ws0">Calculando o juro simples ao final de cada ms, temos: </div><div class="t m0 x48 h9 y9b ff5 fs4 fc0 sc0 ls0 ws0"><span class="ls6"><span class="_ _0"></span></span><span class="_ _4"> </span><span class="_ _5"></span></div><div class="t m0 x20 h9 y9c ff5 fs4 fc0 sc0 ls0 ws0"><span class="ls5"></span></div><div class="t m0 x64 h9 y9d ff5 fs4 fc0 sc0 ls5 ws0"></div><div class="t m0 x15 h3 y9b ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _b"></span><span class="_ _3"> </span><span class="_ _7"> </span><span class="_ _7"> </span>  <span class="_ _4"> </span><span class="_ _7"> </span><span class="_ _4"> </span><span class="_ _7"> </span><span class="ls9"><span class="_ _0"></span></span><span class="ff2 fs0"> </span></div><div class="t m0 x4 h3 y9e ff2 fs0 fc0 sc0 ls0 ws0">Como o capital ficou aplicado por 7 meses, multiplicamos o juro de um ms por </div><div class="t m0 x4 h3 y9f ff2 fs0 fc0 sc0 lsc ws0">7.<span class="ls0"> </span></div><div class="t m0 x1a h3 ya0 ff5 fs4 fc0 sc0 ls0 ws0">  <span class="_ _4"> </span><span class="_ _7"> </span><span class="ls5"></span><span class="_ _7"> </span><span class="_ _7"> </span><span class="ls9"></span><span class="ff2 fs0"> </span></div><div class="t m0 x4 h3 ya1 ff2 fs0 fc0 sc0 ls0 ws0">Note que, para determinar o valor do juro, multiplicamos o valor do </div><div class="t m0 x4 h3 ya2 ff2 fs0 fc0 sc0 ls0 ws0">investimento pela taxa de juro e pelo tempo da aplicao, ou seja: </div><div class="t m0 x2 h8 ya3 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _7"> </span><span class="_ _7"> </span>    <span class="ff2"> </span></div><div class="t m0 x6c h8 ya4 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _4"> </span><span class="_ _7"> </span><span class="_ _0"></span>  <span class="_ _f"> </span> <span class="_ _7"> </span><span class="_ _7"> </span><span class="ls5"></span><span class="ff2"> </span></div><div class="t m0 x4 h3 ya5 ff2 fs0 fc0 sc0 ls0 ws0">Como queremos determinar o montante, adicionamos o capital e o j<span class="_ _2"></span>uro. <span class="_ _0"></span> </div><div class="t m0 x2 h8 ya6 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _7"> </span><span class="_ _4"> </span><span class="_ _3"> </span> <span class="ff2"> </span></div><div class="t m0 x6c h8 ya7 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _7"> </span><span class="_ _7"> </span>  <span class="ls5"></span><span class="_ _4"> </span><span class="_ _7"> </span><span class="ls5"></span><span class="ff2"> </span></div><div class="t m0 x4 h3 ya8 ff2 fs0 fc0 sc0 ls0 ws0">Portanto, o montante obtido por Simone ao final de 7 mes<span class="_ _2"></span>es  R$1<span class="_ _0"></span> 045,50. </div><div class="t m0 x4 h3 y93 ff2 fs0 fc0 sc0 ls0 ws0">Calculamos o juro simples por meio da frmula: </div><div class="t m0 x2 h3 ya9 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _7"> </span><span class="_ _7"> </span>    <span class="ff2 fs0"> </span></div><div class="t m0 x4 h3 yaa ff2 fs0 fc0 sc0 ls0 ws0">j: juro </div><div class="t m0 x4 h3 yab ff2 fs0 fc0 sc0 ls0 ws0">c: capital </div><div class="t m0 x4 h3 yac ff2 fs0 fc0 sc0 ls0 ws0">i: taxa de juro simples </div><div class="t m0 x4 h3 yad ff2 fs0 fc0 sc0 ls0 ws0">t: perodo de tempo </div><div class="t m0 x4 h3 yae ff2 fs0 fc0 sc0 ls0 ws0">Para calcular o montante, utilizamos a seguinte frmula: </div><div class="t m0 xa h3 yaf ff5 fs0 fc0 sc0 ls0 ws0"><span class="_ _3"> </span><span class="_ _3"> </span>  <span class="_ _3"> </span><span class="fs4"><span class="_ _4"> </span> <span class="_ _3"> </span> <span class="_ _5"></span> <span class="_ _10"> </span><span class="_ _10"> </span><span class="_ _f"> </span><span class="_ _3"> </span> <span class="_ _4"> </span> <span class="_ _0"></span><span class="_ _10"> </span><span class="_ _10"> </span> <span class="_ _10"> </span></span><span class="ff2"> </span></div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf6" class="pf w0 h0" data-page-no="6"><div class="pc pc6 w0 h0"><img class="bi x1e yb0 w3 hf" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x4 h3 y2 ff2 fs0 fc0 sc0 ls0 ws0">Nessas frmulas, ao substituir a taxa de juro, devemos escrev-la na forma </div><div class="t m0 x4 h3 yb1 ff2 fs0 fc0 sc0 ls0 ws0">decim<span class="lsc">al</span></div><div class="t m0 x4 h3 yb2 ff2 fs0 fc0 sc0 ls0 ws0">Ao utilizar as frmulas apresentadas anteriormente, temos que verificar se a </div><div class="t m0 x4 h3 yb3 ff2 fs0 fc0 sc0 ls0 ws0">taxa de juro e o perodo de tempo esto em uma mesma unidade de<span class="_ _2"></span> tempo. </div><div class="t m0 x4 h3 yb4 ff2 fs0 fc0 sc0 ls0 ws0">Por exemplo, se a taxa de juro  dada ao ano, o perodo de tempo tambm </div><div class="t m0 x4 h3 yb5 ff2 fs0 fc0 sc0 ls0 ws0">deve estar em anos. Em casos em que isso no ocorra, devemos transformar a </div><div class="t m0 x4 h3 yb6 ff2 fs0 fc0 sc0 ls0 ws0">taxa ou o perodo  mesma unidade de tempo. </div><div class="t m0 x4 h3 yb7 ff2 fs0 fc0 sc0 ls0 ws0">No juro simples, uma taxa de 2,1% a. m., por exemplo  equivalente a 25,<span class="_ _2"></span>2% </div><div class="t m0 x4 h3 yb8 ff2 fs0 fc0 sc0 ls0 ws0">a.a., pois <span class="ff5 fs4"></span></div></div><div class="c x1 y1 w10 h0"><div class="t m0 x6d h9 yb9 ff5 fs4 fc0 sc0 ls0 ws0"></div></div><div class="c x6e y1 w5 h0"><div class="t m0 x2a h9 yb9 ff5 fs4 fc0 sc0 ls0 ws0"></div></div><div class="c x6f y1 w11 h0"><div class="t m0 x2a h9 yb9 ff5 fs4 fc0 sc0 ls0 ws0"></div></div><div class="c x1 y1 w2 h0"><div class="t m0 x70 hc y9c ff5 fs5 fc0 sc0 ls0 ws0"><span class="ls7"></span></div><div class="t m0 x2e h9 yb8 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _d"></span> <span class="ls5"><span class="_ _4"> </span></span><span class="_ _7"> </span><span class="ls5"></span></div></div><div class="c x1 y1 w12 h0"><div class="t m0 x71 h9 yb9 ff5 fs4 fc0 sc0 ls0 ws0"></div></div><div class="c x3 y1 w5 h0"><div class="t m0 x2a h9 yb9 ff5 fs4 fc0 sc0 ls0 ws0"></div></div><div class="c x67 y1 w13 h0"><div class="t m0 x2a h9 yb9 ff5 fs4 fc0 sc0 ls0 ws0"></div></div><div class="c x1 y1 w2 h0"><div class="t m0 x1a hc y9c ff5 fs5 fc0 sc0 ls7 ws0"><span class="ls0"></span></div><div class="t m0 x72 h8 yb8 ff2 fs4 fc0 sc0 ls0 ws0"> .<span class="fs0"> </span></div><div class="t m0 x4 h3 yba ff2 fs0 fc0 sc0 ls0 ws0">De maneira semelhante, uma taxa de 36% a.a.  equivalente a 3% a.<span class="_ _0"></span>m., pois  </div><div class="t m0 x65 h9 y55 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ls5"></span></div><div class="t m0 x3f h9 ybb ff5 fs4 fc0 sc0 ls0 ws0"></div><div class="t m0 x16 hc ybc ff5 fs5 fc0 sc0 ls7 ws0"></div><div class="t m0 x7 h9 y55 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _7"> </span><span class="ls5"><span class="_ _4"> </span></span><span class="_ _7"> </span><span class="ls5"></span></div><div class="t m0 x73 h9 ybb ff5 fs4 fc0 sc0 ls0 ws0"></div><div class="t m0 x59 hc ybc ff5 fs5 fc0 sc0 ls7 ws0"></div><div class="t m0 x74 h3 y55 ff2 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x4 h2 ybd ff1 fs0 fc2 sc0 ls0 ws0">Atividade resolvida </div><div class="t m0 x4 h2 ybe ff1 fs0 fc2 sc0 ls0 ws0">R8.<span class="ff2"> <span class="fc0">Srgio aplicou R$12 000,00 no sistema de juro simples e, aps 10 meses, </span></span></div><div class="t m0 x4 h3 ybf ff2 fs0 fc0 sc0 ls0 ws0">retirou o montante de R$12 900,00. Qual foi a taxa mensal de juro que rendeu </div><div class="t m0 x4 h3 yc0 ff2 fs0 fc0 sc0 ls0 ws0">o investimento de Srgio? </div><div class="t m0 x4 h3 yc1 ff2 fs0 fc2 sc0 ls0 ws0">Resoluo </div><div class="t m0 x4 h3 y18 ff2 fs0 fc0 sc0 ls0 ws0">Utilizando a frmula <span class="ff5"><span class="_ _3"> </span><span class="_ _3"> </span> </span></div><div class="t m0 x3 h6 yc2 ff5 fs0 fc0 sc0 ls0 ws0"></div><div class="t m0 x25 h6 y18 ff5 fs0 fc0 sc0 ls0 ws0">    </div><div class="t m0 x8 h6 yc2 ff5 fs0 fc0 sc0 ls0 ws0"></div><div class="t m0 x75 h3 y18 ff2 fs0 fc0 sc0 ls0 ws0">, para M=12 900, c=12 000 e t=10, temos: </div><div class="t m0 x4 h9 yc3 ff5 fs4 fc0 sc0 ls5 ws0"><span class="ls0"><span class="_ _4"> </span><span class="_ _7"> </span></span><span class="ls0">      </span><span class="ls0"><span class="_ _4"> </span><span class="_ _9"></span></span></div><div class="t m0 x12 hc yc4 ff5 fs5 fc0 sc0 ls7 ws0"><span class="ls0"></span></div><div class="t m0 x76 hc yc5 ff5 fs5 fc0 sc0 ls7 ws0"><span class="ls0"></span></div><div class="t m0 x59 h9 yc3 ff5 fs4 fc0 sc0 ls0 ws0"><span class="_ _7"> </span>  <span class="ls5"> </span> <span class="_ _a"> </span><span class="_ _4"> </span><span class="ls5"> </span> <span class="_ _4"> </span></div><div class="t m0 x4 h8 yc6 ff5 fs4 fc0 sc0 ls5 ws0"> <span class="ls0"> <span class="_ _4"> </span><span class="_ _7"> </span><span class="_ _a"> </span><span class="_ _7"> </span><span class="_ _4"> </span><span class="_ _7"> </span><span class="ff2">  </span></span></div><div class="t m0 x4 h3 y45 ff2 fs0 fc0 sc0 ls0 ws0">Portanto, a taxa de juro foi 0,75% a.m. </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
