<div id="pf8" class="pf w0 h0" data-page-no="8"><div class="pc pc8 w0 h0"><img class="bi x99 yef w1c h12" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x4 h2 y71 ff1 fs0 fc2 sc0 ls0 ws0">Atividade Resolvida<span class="fc0"> </span></div><div class="t m0 x4 h2 yf0 ff1 fs0 fc2 sc0 ls0 ws0">R<span class="lsc">1.</span><span class="ff2"> <span class="fc0">Utilizando uma calculad<span class="lsc">or</span>a, determine o montante obtido ao final de cada </span></span></div><div class="t m0 x4 h3 y73 ff2 fs0 fc0 sc0 ls0 ws0">um dos trs primeiros meses, ao investir um capital de R$ 235,00 a juro </div><div class="t m0 x4 h3 y75 ff2 fs0 fc0 sc0 ls0 ws0">composto de 5% ao ms. </div><div class="t m0 x4 h3 yb3 ff2 fs0 fc2 sc0 ls0 ws0">Resoluo </div><div class="t m0 x4 h3 yf1 ff2 fs0 fc0 sc0 ls0 ws0">O montante, ao final do 1 ms,  obtido acrescentando-se 5% ao capital, ou </div><div class="t m0 x4 h3 yf2 ff2 fs0 fc0 sc0 ls0 ws0">seja, em uma calculadora comum, multiplicamos<span class="_ _0"></span> 1<span class="ff5"></span>0,05<span class="ff5"></span>1,05 por 235, nesta </div><div class="t m0 x4 h3 yf3 ff2 fs0 fc0 sc0 ls0 ws0">ordem. Para determinar o montante do ms seguinte, digitamos novamente a </div><div class="t m0 x4 h3 yf4 ff2 fs0 fc0 sc0 ls0 ws0">tecla =. </div><div class="t m0 x20 h3 yf5 ff2 fs0 fc0 sc0 ls0 ws0">1<span class="ff5"></span> <span class="lsc">0 </span><span class="ff5"></span><span class="lsc">5 </span><span class="ff5"></span> <span class="ff5"><span class="_ _4"> </span><span class="_ _3"> </span><span class="_ _4"> </span><span class="_ _3"> </span><span class="_ _3"> </span><span class="_ _3"> </span><span class="_ _4"> </span></span> </div><div class="t m0 x4 h3 yf6 ff2 fs0 fc0 sc0 ls0 ws0">(escanear) </div><div class="t m0 x4 h3 yf7 ff2 fs0 fc0 sc0 ls0 ws0">Ao digitar novamente a tecla =, a calculadora repete a operao 1 <span class="ff5"></span> 0<span class="_ _0"></span>                </div><div class="t m0 x4 h3 yf8 ff2 fs0 fc0 sc0 ls0 ws0">5 x, isto , multiplica o resultado anterior por 1,05. Desse modo, obtemos o </div><div class="t m0 x4 h3 yf9 ff2 fs0 fc0 sc0 ls0 ws0">montante do ms seguinte no sistema de juro composto. </div><div class="t m0 x4 h3 yfa ff2 fs0 fc0 sc0 ls0 ws0">Portanto, os montantes obtidos ao final dos trs meses so, aprox<span class="_ _2"></span>imadamente, </div><div class="t m0 x4 h3 yfb ff2 fs0 fc0 sc0 ls0 ws0">na ordem: R$246,75, R$259,09 e R$ 272,04<span class="_ _2"></span>.<span class="_ _0"></span> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf9" class="pf w0 h0" data-page-no="9"><div class="pc pc9 w0 h0"><img class="bi x4 yfc w1d h13" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x5 h2 y2 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="ff1">Juro e funes<span class="fc0"> </span></span></span></div><div class="t m0 x4 h3 y3 ff2 fs0 fc0 sc0 ls0 ws0">Nesse tpico, vamos relacionar o juro (simples e composto) e as <span class="_ _2"></span>funes. Para </div><div class="t m0 x4 h3 y49 ff2 fs0 fc0 sc0 ls0 ws0">isso, considere uma aplicao de R$ 1 200,00 a uma taxa de juro de 15% a.a. </div><div class="t m0 x4 h3 y5 ff2 fs0 fc0 sc0 ls0 ws0">Vamos analisar essa aplicao nos regimes de juro simples e de juro composto </div><div class="t m0 x4 h3 y96 ff2 fs0 fc0 sc0 ls0 ws0">no decorrer do tempo. </div><div class="t m0 x4 h3 yfd ff2 fs0 fc0 sc0 ls0 ws0">Inicialmente, substitumos as informaes apresentadas na f<span class="_ _0"></span>rmula do juro </div><div class="t m0 x4 h3 y4d ff2 fs0 fc0 sc0 ls0 ws0">para o regime de juro simples: </div><div class="t m0 x15 h3 yfe ff2 fs0 fc0 sc0 ls0 ws0">c<span class="ff5"></span>1 200; i<span class="ff5"></span><span class="lsc">15%</span><span class="ff5"></span>0,15 </div><div class="t m0 x66 h3 yff ff2 fs0 fc0 sc0 ls0 ws0">j<span class="ff5"></span>c <span class="ff5"></span> <span class="ls4">i </span><span class="ff5"></span> t </div><div class="t m0 x16 h3 y100 ff2 fs0 fc0 sc0 ls0 ws0">j<span class="ff5"></span>1 200 <span class="ff5"></span> 0,15 <span class="ff5"></span> t </div><div class="t m0 x2 h2 y101 ff2 fs0 fc0 sc0 ls4 ws0">j <span class="ff5 ls0"><span class="ff2">180t (<span class="ff1">I</span>) </span></span></div><div class="t m0 x4 h2 y102 ff2 fs0 fc0 sc0 ls0 ws0">O juro j est em funo do tempo t e (<span class="ff1">I</span>) corresponde a uma <span class="ff1">funo</span> <span class="ff1">linear. </span></div><div class="t m0 x4 h3 yf9 ff2 fs0 fc0 sc0 ls0 ws0">Podemos representar e essa funo da seguinte maneira: </div><div class="t m0 x14 h3 yfa ff2 fs0 fc0 sc0 ls0 ws0">f<span class="ff5"><span class="_ _9"></span></span></div><div class="t m0 x3e h11 y103 ff5 fs7 fc0 sc0 ls0 ws0"></div><div class="t m0 x57 h3 yfa ff5 fs0 fc0 sc0 ls0 ws0"><span class="_ _3"> </span><span class="ff2"> dada por f(t)</span><span class="ff2 lsc">180t<span class="ls0"> </span></span></div></div><div class="c x4 y104 w1e h14"><div class="t m0 x9a h3 y105 ff2 fs0 fc0 sc0 ls0 ws0">t </div></div><div class="c x4d y104 w1f h14"><div class="t m0 x9b h3 y106 ff2 fs0 fc0 sc0 ls4 ws0">j <span class="ff5 ls0"><span class="ff2"> f<span class="_ _0"></span>(t) </span></span></div></div><div class="c x4 y107 w1e h15"><div class="t m0 x9c h3 y108 ff2 fs0 fc0 sc0 ls0 ws0"> 0 </div></div><div class="c x4d y107 w1f h15"><div class="t m0 x9d h3 y108 ff2 fs0 fc0 sc0 ls0 ws0">0 </div></div><div class="c x4 y109 w1e h15"><div class="t m0 x9d h3 y108 ff2 fs0 fc0 sc0 ls0 ws0">1 </div></div><div class="c x4d y109 w1f h15"><div class="t m0 x9e h3 y108 ff2 fs0 fc0 sc0 lsc ws0">180<span class="ls0"> </span></div></div><div class="c x4 y10a w1e h15"><div class="t m0 x9d h3 y108 ff2 fs0 fc0 sc0 ls0 ws0">2 </div></div><div class="c x4d y10a w1f h15"><div class="t m0 x9e h3 y108 ff2 fs0 fc0 sc0 lsc ws0">360<span class="ls0"> </span></div></div><div class="c x4 y10b w1e h16"><div class="t m0 x9d h3 y10c ff2 fs0 fc0 sc0 ls0 ws0">3 </div></div><div class="c x4d y10b w1f h16"><div class="t m0 x9e h3 y10c ff2 fs0 fc0 sc0 lsc ws0">540<span class="ls0"> </span></div></div><div class="c x1 y1 w2 h0"><div class="t m0 x4 h3 y10d ff2 fs0 fc0 sc0 ls0 ws0">  </div><div class="t m0 x4 h3 yc3 ff2 fs0 fc0 sc0 ls0 ws0">(grfico) </div><div class="t m0 x4 h3 y10e ff2 fs0 fc0 sc0 ls0 ws0">Agora, vamos substituir as informaes apresentadas na frmula do montante </div><div class="t m0 x4 h3 y10f ff2 fs0 fc0 sc0 ls0 ws0">para o regime de juro simples: </div><div class="t m0 x4 h3 y110 ff2 fs0 fc0 sc0 ls0 ws0">(equao) </div><div class="t m0 x4 h2 y111 ff2 fs0 fc0 sc0 ls0 ws0">O montante M est em funo do tempo t e (<span class="ff1 lse">II<span class="_ _0"></span></span>) corresponde a uma <span class="ff1">funo </span></div><div class="t m0 x4 h2 y112 ff1 fs0 fc0 sc0 ls0 ws0">afim. </div><div class="t m0 x4 h3 y113 ff2 fs0 fc0 sc0 ls0 ws0">Podemos representar essa funo da seguinte maneira: </div><div class="t m0 x4 h3 y114 ff2 fs0 fc0 sc0 ls0 ws0">(equao) </div><div class="t m0 x4 h3 y115 ff2 fs0 fc0 sc0 ls0 ws0">(tabela) </div><div class="t m0 x4 h3 y116 ff2 fs0 fc0 sc0 ls0 ws0">De maneira semelhante, vamos substituir as in<span class="_ _2"></span>formaes apresentadas na </div><div class="t m0 x4 h3 y117 ff2 fs0 fc0 sc0 ls0 ws0">frmula do montante para o regime de juro compos<span class="_ _0"></span>to: </div><div class="t m0 x4 h3 y118 ff2 fs0 fc0 sc0 ls0 ws0">(equao) </div><div class="t m0 x4 h2 y119 ff2 fs0 fc0 sc0 ls0 ws0">O montante M est em funo do tempo t e (<span class="ff1">III</span>) corresponde a uma funo do </div><div class="t m0 x4 h3 y11a ff2 fs0 fc0 sc0 ls0 ws0">tipo exponencial. Podemos representar essa funo da seguinte maneira: </div><div class="t m0 x4 h3 y11b ff2 fs0 fc0 sc0 ls0 ws0">(equao) </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pfa" class="pf w0 h0" data-page-no="a"><div class="pc pca w0 h0"><img class="bi x1e y11c w3 h17" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x4 h3 y2 ff2 fs0 fc0 sc0 ls0 ws0">(tabela) </div><div class="t m0 x4 h3 y11d ff2 fs0 fc0 sc0 ls0 ws0">Atividades Resolvidas </div><div class="t m0 x4 h3 y11e ff2 fs0 fc0 sc0 ls0 ws0">R14. Paulo aplicou R$ 2.900,00 a juro simples de 11% a. <span class="_ _0"></span>a. e, no mesmo dia, </div><div class="t m0 x4 h3 y11f ff2 fs0 fc0 sc0 ls0 ws0">Roberto investiu R$ 2.800,00 a juro composto de 10% a. a. Represente </div><div class="t m0 x4 h3 y6 ff2 fs0 fc0 sc0 ls0 ws0">graficamente, num mesmo plano cartesiano, os montantes em cada aplicao </div><div class="t m0 x4 h3 yfd ff2 fs0 fc0 sc0 ls0 ws0">e verifique qual ter o maior montante ao final de 4 anos e ao final d<span class="_ _2"></span>e 6 anos.<span class="_ _0"></span> </div><div class="t m0 x4 h3 y120 ff2 fs0 fc0 sc0 ls0 ws0">Resoluo </div><div class="t m0 x4 h3 y121 ff2 fs0 fc0 sc0 ls0 ws0">(equao) </div><div class="t m0 x4 h3 y122 ff2 fs0 fc0 sc0 ls0 ws0">(tabela) </div><div class="t m0 x4 h3 y123 ff2 fs0 fc0 sc0 ls0 ws0">(grfico) </div><div class="t m0 x4 h3 y124 ff2 fs0 fc0 sc0 ls0 ws0">Os valores obtidos para g(t) ao final dos 4, 5 e 6 anos so aproximados </div><div class="t m0 x4 h3 y125 ff2 fs0 fc0 sc0 ls0 ws0">considerando uma casa decimal. </div><div class="t m0 x4 h3 y126 ff2 fs0 fc0 sc0 ls0 ws0">Observando o grfico, podemos notar que, ao final de 4 anos, o montante da </div><div class="t m0 x4 h3 yd7 ff2 fs0 fc0 sc0 ls0 ws0">aplicao de Paulo ser maior que o de Roberto, ou seja, f(4)&gt;g(4). J ao final </div><div class="t m0 x4 h3 y15 ff2 fs0 fc0 sc0 ls0 ws0">de 6 anos, o montante da aplicao de Roberto ser maior que o de Paulo, ou </div><div class="t m0 x4 h3 y127 ff2 fs0 fc0 sc0 ls0 ws0">seja, g(6)&gt;f(6). </div><div class="t m0 x4 h3 y128 ff2 fs0 fc0 sc0 ls0 ws0">Sistema de amortizao </div><div class="t m0 x4 h3 y129 ff2 fs0 fc0 sc0 ls0 ws0">Em algumas situaes, a indisponibilidade de capital para adquirir um bem </div><div class="t m0 x4 h3 y12a ff2 fs0 fc0 sc0 ls0 ws0">pode levar um indivduo a realizar um emprstimo: para sanar o compromisso, </div><div class="t m0 x4 h3 y12b ff2 fs0 fc0 sc0 ls0 ws0">ele pode optar por diversas formas de pagamento. Ao efetuar os pa<span class="_ _2"></span>gamentos<span class="_ _0"></span> </div><div class="t m0 x4 h3 y12c ff2 fs0 fc0 sc0 ls0 ws0">parciais para saldar a divida, ocorre sua amortiz<span class="_ _2"></span>ao.<span class="_ _0"></span> </div><div class="t m0 x4 h2 y12d ff1 fs0 fc0 sc0 ls0 ws0">A<span class="_ _2"></span>mortizao <span class="_ _0"></span><span class="ff2"> o processo de reduo de uma dv<span class="_ _2"></span>ida por meio de pagamentos </span></div><div class="t m0 x4 h3 y12e ff2 fs0 fc0 sc0 ls0 ws0">parciais, que podem ser mensais, bimestrais, anuais, entre outros. <span class="_ _2"></span>Cada </div><div class="t m0 x4 h3 y12f ff2 fs0 fc0 sc0 ls0 ws0">pagamento (ou prestao) realizado corresp<span class="_ _2"></span>onde ao juro e parte do capital </div><div class="t m0 x4 h3 y130 ff2 fs0 fc0 sc0 ls0 ws0">(valor da dvida), sendo o juro calculado sobre o saldo dev<span class="_ _2"></span>edor.<span class="_ _0"></span> </div><div class="t m0 x4 h3 y131 ff2 fs0 fc0 sc0 ls0 ws0">O saldo devedor corresponde  diferena entre o valor da dvida e o que j foi </div><div class="t m0 x4 h3 y132 ff2 fs0 fc0 sc0 ls0 ws0">pago. </div><div class="t m0 x4 h3 ye7 ff2 fs0 fc0 sc0 ls0 ws0">De maneira resumida, a prestao  dada por: </div><div class="t m0 x4 h3 y133 ff2 fs0 fc0 sc0 ls0 ws0">Prestao= Amortizao + Juro </div><div class="t m0 x4 h3 y134 ff2 fs0 fc0 sc0 ls0 ws0">As maneiras de pagamento de uma dvida esto associadas a di<span class="_ _2"></span>fe<span class="_ _0"></span>rentes </div><div class="t m0 x4 h2 y135 ff1 fs0 fc0 sc0 ls0 ws0">sistemas de amortizao, <span class="ff2">sendo dois dos principais o Sistema de </span></div><div class="t m0 x4 h3 y136 ff2 fs0 fc0 sc0 ls0 ws0">Amortizao Constante (SAC), em que a amortizao da dvida  constante, </div><div class="t m0 x4 h3 y119 ff2 fs0 fc0 sc0 ls0 ws0">igual em cada perodo, e o sistema Price ou Frnces, com prestaes fixas. </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pfb" class="pf w0 h0" data-page-no="b"><div class="pc pcb w0 h0"><div class="c x1 y1 w2 h0"><div class="t m0 x4 h3 y2 ff2 fs0 fc0 sc0 ls0 ws0"> Neste tpico iremos estudar o sistema Price, em que o devedor pag<span class="_ _2"></span>a o </div><div class="t m0 x4 h3 yb1 ff2 fs0 fc0 sc0 ls0 ws0">emprstimo em prestaes fixas, sendo o nmero de prestaes varivel de </div><div class="t m0 x4 h3 y137 ff2 fs0 fc0 sc0 ls0 ws0">acordo com o contrato entre as partes (devedor e credor). </div><div class="t m0 x4 h3 y4a ff2 fs0 fc0 sc0 ls0 ws0">Para calcular o valor de cada prestao de um emprstimo no sistema Price, </div><div class="t m0 x4 h3 y4b ff2 fs0 fc0 sc0 ls0 ws0">utilizamos a frmula: </div><div class="t m0 x4 h3 y4c ff2 fs0 fc0 sc0 ls0 ws0">(equao) </div><div class="t m0 x4 h3 y4d ff2 fs0 fc0 sc0 ls0 ws0">Nessa frmula: </div><div class="t m0 x9f h3 y138 ff6 fs0 fc0 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span>P: valor da prestao </span></div><div class="t m0 x9f h3 y139 ff6 fs0 fc0 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span>c:valor do ms ou do emprstimo </span></div><div class="t m0 x9f h3 y13a ff6 fs0 fc0 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span>i:taxa de juro </span></div><div class="t m0 x9f h3 y13b ff6 fs0 fc0 sc0 ls0 ws0"><span class="ff2"> <span class="_ _6"> </span>n: nmero de prestaes </span></div><div class="t m0 x6 h3 y13c ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x6 h3 y13d ff2 fs0 fc0 sc0 ls0 ws0">Paula fez um emprstimo de R$3.000,00 que deve ser pago em 5 prestaes </div><div class="t m0 x6 h3 y13e ff2 fs0 fc0 sc0 ls0 ws0">mensais  taxa de juro de 2,5% a. m. no sistema Pri<span class="_ _2"></span>ce. Utilizando a frmula </div><div class="t m0 x6 h3 y13f ff2 fs0 fc0 sc0 ls0 ws0">apresentada acima podemos calcular o valor de cada prestao<span class="_ _0"></span>: </div><div class="t m0 x6 h3 y140 ff2 fs0 fc0 sc0 ls0 ws0">(Equao) </div><div class="t m0 x6 h3 y141 ff2 fs0 fc0 sc0 ls0 ws0">Portanto, o valor de cada prestao  aproximadamente R$645,74. </div><div class="t m0 x6 h3 y142 ff2 fs0 fc0 sc0 ls0 ws0">Como no sistema Price os pagamentos so parcelados,  conv<span class="_ _2"></span>eniente </div><div class="t m0 x6 h3 y143 ff2 fs0 fc0 sc0 ls0 ws0">construir um demonstrativo indicando a situao da dvida em cada perodo de </div><div class="t m0 x6 h3 y144 ff2 fs0 fc0 sc0 ls0 ws0">tempo. Veja como ficaria o demonstrativo em relao ao emprstimo feito por </div><div class="t m0 x6 h3 y145 ff2 fs0 fc0 sc0 ls0 ws0">Paula. </div><div class="t m0 x6 h3 y146 ff2 fs0 fc0 sc0 ls0 ws0">(Tabela) </div><div class="t m0 x6 h3 y147 ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvidas </div><div class="t m0 x6 h3 y148 ff2 fs0 fc0 sc0 ls0 ws0">R15. Construa um demonstrativo do sistema Price de acordo com as </div><div class="t m0 x6 h3 y149 ff2 fs0 fc0 sc0 ls0 ws0">informaes apresentadas no anncio. </div><div class="t m0 x6 h3 y14a ff2 fs0 fc0 sc0 ls0 ws0">(imagem) </div><div class="t m0 x6 h3 y14b ff2 fs0 fc0 sc0 ls0 ws0">Resoluo  </div><div class="t m0 x6 h3 y14c ff2 fs0 fc0 sc0 ls0 ws0">Inicialmente, calculamos o valor de cada parcela utilizand<span class="_ _0"></span>o a frmula (frmula): </div><div class="t m0 x6 h3 y14d ff2 fs0 fc0 sc0 ls0 ws0">(Equao) </div><div class="t m0 x6 h3 y14e ff2 fs0 fc0 sc0 ls0 ws0">Utilizando uma calculadora cientifica temos: </div><div class="t m0 x6 h3 y14f ff2 fs0 fc0 sc0 ls0 ws0">(equao) </div><div class="t m0 x6 h3 y150 ff2 fs0 fc0 sc0 ls0 ws0">Logo, o valor de cada parcela  aproximadamente<span class="_ _0"></span> R$254,17. </div><div class="t m0 x6 h3 y151 ff2 fs0 fc0 sc0 ls0 ws0">Em seguida construmos o demonstrativo. </div><div class="t m0 x6 h3 y152 ff2 fs0 fc0 sc0 ls0 ws0">(Tabela) </div><div class="t m0 x6 h3 y153 ff2 fs0 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pfc" class="pf w0 h0" data-page-no="c"><div class="pc pcc w0 h0"><div class="c x1 y1 w2 h0"><div class="t m0 x6 h3 y2 ff2 fs0 fc0 sc0 ls0 ws0">2 ano Captulo 1 <span class="ff4"></span> Trigonometria na circunferncia e funes trigonomtricas </div><div class="t m0 x5 h3 y3 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="fc0">Trigonometria na circunferncia </span></span></div><div class="t m0 x10 h3 y49 ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x10 h3 y4a ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x5 h3 y4b ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="fc0">Seno, cosseno e tangente de um arco </span></span></div><div class="t m0 x10 h3 y154 ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x10 h3 y155 ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x5 h3 y156 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="fc0">Funes trigonomtricas </span></span></div><div class="t m0 x10 h3 y157 ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x10 h3 y158 ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x6 h3 y159 ff2 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x6 h3 y15a ff2 fs0 fc0 sc0 ls0 ws0">3 ano Captulo 1 <span class="ff4"></span> Matemtica financeira </div><div class="t m0 x5 h3 y15b ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="fc0">Porcentagem </span></span></div><div class="t m0 x10 h3 y15c ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x10 h3 y15d ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x5 h3 y15e ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="fc0">Acrscimos e descontos sucessivos </span></span></div><div class="t m0 x10 h3 y15f ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x10 h3 y160 ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x5 h3 y161 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="fc0">Juro </span></span></div><div class="t m0 x10 h3 y162 ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x10 h3 y163 ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x5 h3 y17 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="fc0">Juro e funes </span></span></div><div class="t m0 x10 h3 y18 ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x10 h3 y164 ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x5 h3 y165 ff3 fs0 fc1 sc0 ls0 ws0"><span class="ff2"> <span class="_ _1"> </span><span class="fc0">Sistema de amortizao </span></span></div><div class="t m0 x10 h3 y166 ff2 fs0 fc0 sc0 ls0 ws0">Exemplo </div><div class="t m0 x10 h3 y167 ff2 fs0 fc0 sc0 ls0 ws0">Atividade Resolvida </div><div class="t m0 x10 h3 y168 ff2 fs0 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
